Real Lovemaking, Real Orgasms!

It isn't being young and misunderstood, and when these girls lack direction and need some guidance, only an older man can lead them to the right path. They are your teachers, your neighbors, your best friend's dads: they are father figures. Superstars Riley Reid, Maddy O'Reilly, Presley Hart and more engage in the forbidden relationships that break down generation gaps. These older guys might just be able to re-learn something about life and love in Father Figure Vol. 3, Written and directed by James Avalon! 

